import navcss from './nav.module.css';
export default function Navbar(prop){
    const { situacao } = prop;
    return(
        <nav className={navcss.nav}>
            <ul>
                <li>{situacao}</li>
                <li>link1</li>
                <li>link1</li>
                <li>link1</li>
                <li>link1</li>
            </ul>
        </nav>
    )
}
